import {
    Button,
    Table,
    Tag,
    Modal,
    Popover,
    Switch
} from 'antd'
import axios from 'axios'

export default function RoleList() {

    const [dataSource, setDataSource] = useState([])
    const columns = [
        {
            title: 'ID',
            dataIndex: 'id',
            render:() =>{
                return <b>{id}</b>
            }
        },
    ]

    useEffect( () => {
        axios.get('http://localhost:5000/roles')
            .then(res => {
                console.log(res.data)
                setDataSource(res.data)
            })
    },[])

  return (
    <div>
        <Table 
            dataSource={dataSource} 
            columns={columns}
            rowKey={(item) => item.id} 
        />
    </div>
  )
}
